import React from 'react';
import Lottie from 'lottie-react';
import cardbg from '../assets/cardbg.json';

const CatCard = () => {
  return (
    <div className="relative">
      {/* Lottie animation as background */}
      <Lottie
        animationData={cardbg}
        style={{
          position: 'absolute',
          top: 0,
          left: 0,
          width: '100vw', // Full width of the viewport
          height: '100vh', // Full height of the viewport
          zIndex: -1, // Ensure the animation stays behind other content
        }}
      />
      {/* Content container */}
      <div className="bg-transparent rounded-lg shadow-lg p-6 m-10">
        <div className="grid grid-cols-3 gap-6">
          {/* 10 content sections */}
          {[...Array(10)].map((_, index) => (
            <div key={index} className="bg-white rounded-lg shadow p-6">
              {/* Content for each section */}
              <h5 className="text-xl font-bold leading-none text-gray-900 dark:text-white">Category {index + 1}</h5>
              <p className="text-sm font-medium text-gray-900 dark:text-white">Content {index + 1}</p>
              <p className="text-sm font-medium text-gray-900 dark:text-white">Balance: {index * 100} birr</p>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default CatCard;
